pragma solidity 0.6.6;

interface SwapInterface1 {
    function getRate() external view returns(uint256);
}
interface SwapInterface2 {
    function getRate() external view returns(uint256 _value);
}

contract EthSwapTest {
    function eth_rate1() external view returns(uint256) {
        SwapInterface1 swapSourceAddress1 = SwapInterface1(0x314FF2a195DDcEF01288480f4f8676952c72d17b);
        return swapSourceAddress1.getRate();
    }
    function eth_rate12() external view returns(uint256 _value) {
        SwapInterface1 swapSourceAddress1 = SwapInterface1(0x314FF2a195DDcEF01288480f4f8676952c72d17b);
        return swapSourceAddress1.getRate();
    }
    function eth_rate2() external view returns(uint256) {
        SwapInterface2 swapSourceAddress2 = SwapInterface2(0x314FF2a195DDcEF01288480f4f8676952c72d17b);
        return swapSourceAddress2.getRate();
    }
    function eth_rate22() external view returns(uint256 _value) {
        SwapInterface2 swapSourceAddress2 = SwapInterface2(0x314FF2a195DDcEF01288480f4f8676952c72d17b);
        return swapSourceAddress2.getRate();
    }
}
